    localClickHandler = e => {
        console.log(e.target)
    }
    render(){

        return(
            <div className="categories">
                <h5>Category filters</h5>
                <button onClick={this.localClickHandler}>All</button>
                <button>Code</button>
                <button>Food</button>
                <button>Money</button>
                <button>Misc</button>


            </div>
        )
    }
}

export default CategoriesForm
